import React from 'react';

const EditarButton = ({ onClick }) => {
  return (
    <div className="is-pulled-right">
      <button className="button is-primary" onClick={onClick}>
        <span className="icon">
          <i className="fas fa-edit"></i>
        </span>
        <span>Editar</span>
      </button>
    </div>
  );
}

export default EditarButton;
